import React from 'react';
import Tribe from './assets/Tribe.png'
import Container from '@mui/material/Container'
import Grid from '@mui/material/Grid';



const Index = () => {
  return( 
    <>  
        <Container>
            <Grid container sm={12} justifyContent='flex-end' >
                <Grid item sm={4} style={{marginTop: 20}} container justifyContent='center'><img src={Tribe} alt='tribe' /></Grid>
                <Grid item sm={4} container justifyContent='center'><h1 className='index-header'>Assignment 1</h1></Grid>
                <Grid item sm={4}><h1 className='index-header'>Assignment 2</h1></Grid>
            </Grid>
        </Container>
    </>
    )
};

export default Index;
